import Transcription from "./Transcription"
import Handwriting from "./Handwiriting"
import Voice from "./Voice"

const Body = ({ onClick }) => {
  return (
    <div>
      <Transcription onSelect = {onClick}/>
      <Voice onSelect = {onClick}/>
      <Handwriting onSelect = {onClick}/>
    </div>
  )
}

export default Body
